var img1_data = "data:image/jpeg;base64,";

var img2_data = "data:image/jpeg;base64,";

var img3_data = "data:image/png;base64,";

var img4_data = "data:image/gif;base64,";

var img_arrow = "data:image/jpeg;base64,";

function init() {
    document.getElementById("uri").value = '';
    document.getElementById("en_mess").value = '';
    document.getElementById("de_mess").value = '';
    document.getElementById("img1").src = img1_data;
    document.getElementById("img2").src = img2_data;
    document.getElementById("img3").src = img3_data;
    document.getElementById("img4").src = img4_data;
    document.getElementById("original").src = '';
    document.getElementById("result").src = '';
    document.getElementById("arrow").src = img_arrow;
    // disbale right click context menu 
    document.addEventListener("contextmenu", function(e){
        e.preventDefault();
    }, false);
}

function img1_click(img1_data) {
    init();
    var t = document.getElementById("original");
    t.src = img1_data;
    encript_data(img1_data);
    decript_data();
}

function img2_click(img2_data) {
    init();
    var t = document.getElementById("original");
    t.src = img2_data;
    encript_data(img2_data);
    decript_data();
}

function img3_click(img3_data) {
    init();
    var t = document.getElementById("original");
    t.src = img3_data;
    encript_data(img3_data);
    decript_data();
}

function img4_click(img4_data) {
    init();
    var t = document.getElementById("original");
    t.src = img4_data;
    encript_data(img4_data);
    decript_data();
}

// ----------------------------------------- ALGORITHM SECTIONS ----------------------------------------- //

// Get algorithm number form API
// var algo_id = Math.floor(Math.random()*9);
var algo_id = 0;

function encript_data(img_data) {
    var t = document.getElementById("uri");
    t.value = img_data;
    var r = taw_encript(img_data);
    var m = document.getElementById("en_mess");
    m.value = r;
}

function taw_encript(data) {
    console.log("Found encripting algorithm number: " + algo_id);
    var r = taw_encripting(data, algo_id);
    return r;
}

function decript_data() {
    var data = document.getElementById("en_mess").value;
    var r = taw_decript(data);
    document.getElementById("de_mess").value = r;
    var i = document.getElementById("result");
    i.src = r;
}

function taw_decript(data) {
    console.log("Found decripting algorithm number: " + algo_id);
    var r = taw_decripting(data, algo_id);
    return r;
}

function taw_encripting(data, algo_number) {
    var r = null;
    switch(algo_number){
    case 0:
        r = encript_000(data);
        break;
    case 1:
        r = encript_001(data);
        break;
    case 2:
        r = encript_002(data);
        break;
    case 3:
        r = encript_003(data);
        break;
    case 4:
        r = encript_004(data);
        break;
    case 5:
        r = encript_005(data);
        break;
    case 6:
        r = encript_006(data);
        break;
    case 7:
        r = encript_007(data);
        break;
    case 8:
        r = encript_008(data);
        break;
    case 9:
        r = encript_009(data);
        break;
    default:
        r = encript_000(data);
        break;
    }
    return r;
}

function taw_decripting(data, algo_number) {
    var r = null;
    switch(algo_number){
    case 0:
        r = decript_000(data);
        break;
    case 1:
        r = decript_001(data);
        break;
    case 2:
        r = decript_002(data);
        break;
    case 3:
        r = decript_003(data);
        break;
    case 4:
        r = decript_004(data);
        break;
    case 5:
        r = decript_005(data);
        break;
    case 6:
        r = decript_006(data);
        break;
    case 7:
        r = decript_007(data);
        break;
    case 8:
        r = decript_008(data);
        break;
    case 9:
        r = decript_009(data);
        break;
    default:
        r = decript_000(data);
        break;
    }
    return r;
}

